    @Before
    fun setUp() {
        MockitoAnnotations.initMocks(this)
        viewModel = TunesViewModel(getTracksList)
    }

    @OptIn(ExperimentalCoroutinesApi::class)
    @Test
    fun `make sure the result is not null`() =
        testCoroutineRule.runBlockingTest {
            val expectedOutput = TrackResponse.SUCCESS(outputdata)
            viewModel.musicTrack.observeForever(observer)
            Mockito.`when`(viewModel.musicTrack.value).thenAnswer {
                flowOf(expectedOutput)
            }
            viewModel.subscribeToMusicList(TunesApi.MUSIC_CLASSIC)

            Assert.assertNotNull(viewModel.musicTrack.value)
        }

