, Armageddon) comes a gripping true story about bravery, camaradarie and the complex reality of war. Black Hawk Down stars an exceptional cast including Josh Hartnett (Pearl Harbor), Ewan McGregor (Moulin Rouge!), Tom Sizemore (Saving Private Ryan), Eric Bana (Chopper), William Fichtner (The Perfect Storm), Ewen Bremner (Snatch) and Sam Shepard (All The Pretty Horses). In 1993, an elite group of American Rangers and Delta Force soldiers are sent to Somalia on a critical mission to capture a violent warlord whose corrupt regime has lead to the starvation of hundreds of thousands of Somalis. When the mission goes terribly wrong, the men find themselves outnumbered and literally fighting for their lives.\", \"hasITunesExtras\":true}, {\"wrapperType\":\"track\", \"kind\":\"song\", \"artistId\":462599, \"collectionId\":1482686693, \"trackId\":1482686900, \"artistName\":\"Johnny Mathis\", \"collectionName\":\"The Christmas Music Of Johnny Mathis: A Personal Collection\", \"trackName\":\"We Need a Little Christmas\", \"collectionCensoredName\":\"The Christmas Music Of Johnny Mathis: A Personal Collection\", \"trackCensoredName\":\"We Need a Little Christmas\", \"artistViewUrl\":\"https://music.apple.com/us/artist/johnny-mathis/462599?uo=4\", \"collectionViewUrl\":\"https://music.apple.com/us/album/we-need-a-little-christmas/1482686693?i=1482686900&uo=4\", \"trackViewUrl\":\"https://music.apple.com/us/album/we-need-a-little-christmas/1482686693?i=1482686900&uo=4\", \"previewUrl\":\"https://audio-ssl.itunes.apple.com/itunes-assets/AudioPreview125/v4/2a/92/79/2a9279f0-de0f-9f1b-1745-1105bbf2f5e2/mzaf_12246710309842767872.plus.aac.p.m4a\", \"artworkUrl30\":\"https://is1-ssl.mzstatic.com/image/thumb/Music113/v4/72/e2/45/72e24595-6644-5e15-1dae-277c8067e552/886448003649.jpg/30x30bb.jpg\", \"artworkUrl60\":\"https://is1-ssl.mzstatic.com/image/thumb/Music113/v4/72/e2/45/72e24595-6644-5e15-1dae-277c8067e552/886448003649.jpg/60x60bb.jpg\", \"artworkUrl100\":\"https://is1-ssl.mzstati